import React from 'react';

const VideoList = (props) => {
  const listOfVideos = () => {
    return props.map();
  };

  return (
    <div>
      <video width="320" height="240" controls>
        <source src="movie.mp4" type="video/mp4" />
        <source src="movie.ogg" type="video/ogg" />
      </video>
    </div>
  );
};

export default VideoList;
